    false,nt"url": null,nt"notes": "NODC Accession 0124186 contains raw underway
    meteorological, navigational, optical, physical and time series data logged by the
    Scientific Computer System (SCS) aboard NOAA Ship Oscar Dyson in the Gulf of Alaska
    from 2013-03-14 to 2013-03-28. Office of Marine and Aviation Operations (OMAO) personnel
    aboard the ship submitted these data and associated metadata to NODC. In addition,
    NODC Accession 0124186 contains supplementary cruise-level metadata, which OMAO
    personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel
    developed the automated process to archive these data under the auspices of the
